import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Cookies from 'js-cookie';

function Dashboard() {
  const navigate = useNavigate();

  const handleGoogleLogin = async () => {
    try {
      // Redirect to Google authentication endpoint on your backend
      window.location.href = 'http://localhost:5000/google'; // Replace with your actual endpoint
    } catch (error) {
      console.error('Error logging in with Google:', error);
    }
  };

  useEffect(() => {
    // Check if the 'token' cookie exists (this could be moved to a separate utility function)
    const tokenCookie = document.cookie.split(';').find(cookie => cookie.trim().startsWith('token='));

    if (tokenCookie) {
      console.log('Token cookie exists:', tokenCookie);
    } else {
      console.log('Token cookie does not exist or is not accessible.');
    }

    // If you want to automatically navigate back to the previous page after 3 seconds
    const timeout = setTimeout(() => {
      navigate(-1); // Navigate back to the previous page
    }, 3000); // Change the delay (in milliseconds) as needed

    return () => clearTimeout(timeout); // Clear the timeout on component unmount
  }, [navigate]);
  // useEffect(() => {
  //   // Check if there is a query parameter in the URL (callback from Google)
  //   const urlParams = new URLSearchParams(window.location.search);
  //   const googleCallback = urlParams.get('http://localhost:3000/inventory');

  //   if (googleCallback === 'success') {
  //     // If the callback is successful, navigate to the current location to trigger a re-render
  //     navigate(); // This will navigate to the current location, effectively triggering a re-render
  //   }
  // }, [navigate]);

  return (
    <div>
      <h1>Welcome</h1>
      <button onClick={handleGoogleLogin}>Login with Google</button>
    </div>
  );
};

export default Dashboard;
